        b.put("FUTURE_PAYMENT_LEGAL_DETAILS|AU", "<h1><strong>Gelecek \326deme S\366zle\u015Fmesi</strong></h1><p>PayPal hesab\u0131n\u0131zdan gelecekte \347ekim yap\u0131labilmesini sa\u011Flamak i\347in bu uygulama, k\374\347\374k bir test i\u015Flem sim\374le edebilir ancak para transferi ger\347ekle\u015Fmeyecektir.</p><p>Varsay\u0131lan \366deme y\366nteminiz (s\u0131ras\u0131yla PayPal bakiyeniz, tan\u0131ml\u0131 banka hesab\u0131, banka veya kredi kart\u0131) PayPal al\u0131\u015Fveri\u015Flerinizin \366demesi i\347in kullan\u0131lacakt\u0131r. Varsay\u0131lan \366deme y\366nteminizin al\u0131\u015Fveri\u015Fi kar\u015F\u0131layacak yeterli bakiyeye sahip olmamas\u0131 durumund bankan\u0131z veya kart sa\u011Flay\u0131c\u0131n\u0131z sizden \374cret alabilir.</p><p>Bu s\366zle\u015Fmeyi iptal etmek i\347in PayPal hesab\u0131n\u0131za giri\u015F yap\u0131n ve <strong>Profil</strong>, ard\u0131ndan <strong>Ayarlar\u0131m</strong> ve \u201CPayPal ile Giri\u015F Yap\u0131n\u201D se\347ene\u011Finin yan\u0131ndaki <strong>De\u011Fi\u015Ftir</strong> se\347ene\u011Fini t\u0131klay\u0131n.</p>");
